import React from "react"
import "./home.css"


const Home = () => {
    return (
        <div className="home">
            <h1>Welcome</h1>
            <h2>Hi, I'm Matt, a West London based self taught web developer. I love solving logic problems and building things and am looking for an organisation where I can continue to develop my skills.</h2>
            {/* <h2>Please explore my portfolio, interests, and certificates</h2> */}
        </div>
       
    )
}

export default Home;
